import React from "react";
import "./style.css";

function Images(props) {
  console.log(props.name)
  return (
  <div class="row">
    <div className="col-md-3">
      <img onClick={props.onClick} src={ require("../img/" + props.name)} value={props.key} alt={props.name}></img>
    </div>
  </div>
  );
}

export default Images;
